  true,\n\t\"url\": null,\n\t\"notes\": \"The National Assessment of Educational Progress,
  2012 (NAEP 2012), is a study that is part of the National Assessment of Educational
  Progress (NAEP) program; program data is available since 1990 at http://nces.ed.gov/nationsreportcard/naepdata/.
  NAEP 2012 (http://nces.ed.gov/nationsreportcard/) is a cross-sectional survey that
  assesses what America's students know and can do in economics. Students in grade
  12 were sampled. NAEP 2012 assessments consist of national assessment in economics.
  Key statistics produced from NAEP 2012 are results on subject-matter achievement,
  instructional experiences, and school environment for populations of students (e.g.,
  all fourth-graders) and groups within those populations (e.g. female students, Hispanic
  students).\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
